import MUIDataTable from 'mui-datatables'

const columns = [
	{
		name: 'userId',
		label: 'User ID',
		options: {
			filter: false,
			sort: false
		}
	},
	{
		name: 'recency',
		label: 'Recency',
		options: {
			filter: false,
			sort: false
		}
	},
	{
		name: 'frequency',
		label: 'Frequency',
		options: {
			filter: false,
			sort: false
		}
	},
	{
		name: 'monetary',
		label: 'Monetary',
		options: {
			filter: false,
			sort: false
		}
	},
	{
		name: 'rscore',
		label: 'R Score',
		options: {
			filter: false,
			sort: false
		}
	},
	{
		name: 'fscore',
		label: 'F Score',
		options: {
			filter: false,
			sort: false
		}
	},
	{
		name: 'mscore',
		label: 'M Score',
		options: {
			filter: false,
			sort: false
		}
	},
	{
		name: 'rfmScore',
		label: 'RFM Score',
		options: {
			sort: true
		}
	}
]

const options = {
	download: false,
	print: false
}

const UserRFM = ({ data }) => {
	return <MUIDataTable title={'User RFM'} data={data} columns={columns} options={options} />
}

export default UserRFM
